import { AuthProvider } from './Contexts/AuthContext';
const { setAuth } = useContext(AuthContext);
class Login extends React.Component {

    render() {
        return (
            <>
            <h1>LOGIN PAGE</h1>
            <button onClick={setAuth(true)}> FAKE LOGIN </button>
            </>
        );
    }
}

export default Login;
